import React, { Component } from 'react';
import "../styles/friendsBar.css"

export class FriendsBar extends Component {
    render() {
        return (
            <div id="sidebar">
                <div class="toggle">
                    <span></span>
                    <span></span>
                    <span></span>

                </div>
                <ul>
                    <li>Harmeen</li>
                    <li>Keerat</li>
                    <li>Ishaan</li>
                </ul>
            </div>)
    }
}
